description:
Phased mixed-use redevelopment of the site comprising - Demolition of all existing buildings/structures and site clearance, except 82 and (part) 83 Borough Road which are to be retained, altered and refurbished for flexible commercial, business, service and learning and non-residential institution uses (Class E / F1);
  -  Construction of basement structure and vehicular access;
  -  Construction of buildings to provide dwellings (Class C3), flexible commercial, business, service and mixed food/drink/leisure uses (including drinking establishments with expanded food provision, hot food takeaways, live music performance venue and cinema) (Class E / Sui Generis) and public toilets; and
  -  Provision of associated car and cycle parking, open space and landscaping, means of access and highway alterations, installation of plant and utilities and all other associated ancillary works incidental to the development.
